/**
 * This method will check whether the graph passed in is Eulerian or not.
 *
 * @param g The graph to be checked
 *
 * @return true for Eulerian and false for non-Eulerian
 */
public static <V, E> boolean isEulerian(UndirectedGraph<V, E> g) {
    // If the graph is not connected, then no Eulerian circuit exists
    if (!(new ConnectivityInspector<V, E>(g)).isGraphConnected()) {
        return false;
    }
    // A graph is Eulerian if and only if all vertices have even degree
    // So, this code will check for that
    Iterator<V> iter = g.vertexSet().iterator();
    while (iter.hasNext()) {
        V v = iter.next();
        if ((g.degreeOf(v) % 2) == 1) {
            return false;
        }
    }
    return true;
}

/**
 * This method will return a list of vertices which represents the Eulerian
 * circuit of the graph.
 *
 * @param g The graph to find an Eulerian circuit
 *
 * @return null if no Eulerian circuit exists, or a list of vertices
 * representing the Eulerian circuit if one does exist
 */
public static <V, E> List<V> getEulerianCircuitVertices(UndirectedGraph<V, E> g) {
    // If the graph is not Eulerian then just return a null since no
    // Eulerian circuit exists
    if (!isEulerian(g)) {
        return null;
    }
    // The circuit will be represented by a linked list
    List<V> path = new LinkedList<V>();
    UndirectedGraph<V, E> sg = new UndirectedSubgraph<V, E>(g, null, null);
    path.add(sg.vertexSet().iterator().next());
    // Algorithm for finding an Eulerian circuit Basically this will find an
    // arbitrary circuit, then it will find another arbitrary circuit until
    // every edge has been traversed
    while (sg.edgeSet().size() > 0) {
        V v = null;
        // Find a vertex which has an edge that hasn't been traversed yet,
        // and keep its index position in the circuit list
        int index = 0;
        for (Iterator<V> iter = path.iterator(); iter.hasNext(); index++) {
            v = iter.next();
            if (sg.degreeOf(v) > 0) {
                break;
            }
        }
        // Finds an arbitrary circuit of the current vertex and
        // appends this into the circuit list
        while (sg.degreeOf(v) > 0) {
            for (Iterator<V> iter = sg.vertexSet().iterator(); iter.hasNext(); ) {
                V temp = iter.next();
                if (sg.containsEdge(v, temp)) {
                    path.add(index, temp);
                    sg.removeEdge(v, temp);
                    v = temp;
                    break;
                }
            }
        }
    }
    return path;
}

/**
 * This method will return an approximate minimal traveling salesman tour
 * (hamiltonian cycle). This algorithm requires that the graph be complete
 * and the triangle inequality exists (if x,y,z are vertices then
 * d(x,y)+d(y,z) &lt; d(x,z) for all x,y,z) then this algorithm will
 * guarantee a hamiltonian cycle such that the total weight of the cycle is
 * less than or equal to double the total weight of the optimal hamiltonian
 * cycle. The optimal solution is NP-complete, so this is a decent
 * approximation that runs in polynomial time.
 *
 * @param <V>
 * @param <E>
 * @param g is the graph to find the optimal tour for.
 *
 * @return The optimal tour as a list of vertices.
 */
public static <V, E> List<V> getApproximateOptimalForCompleteGraph(SimpleWeightedGraph<V, E> g) {
    List<V> vertices = new LinkedList<V>(g.vertexSet());
    // If the graph is not complete then return null since this algorithm
    // requires the graph be complete
    if ((vertices.size() * (vertices.size() - 1) / 2) != g.edgeSet().size()) {
        return null;
    }
    List<V> tour = new LinkedList<V>();
    // Each iteration a new vertex will be added to the tour until all
    // vertices have been added
    while (tour.size() != g.vertexSet().size()) {
        boolean firstEdge = true;
        double minEdgeValue = 0;
        int minVertexFound = 0;
        int vertexConnectedTo = 0;
        // A check will be made for the shortest edge to a vertex not within
        // the tour and that new vertex will be added to the vertex
        for (int i = 0; i < tour.size(); i++) {
            V v = tour.get(i);
            for (int j = 0; j < vertices.size(); j++) {
                double weight = g.getEdgeWeight(g.getEdge(v, vertices.get(j)));
                if (firstEdge || (weight < minEdgeValue)) {
                    firstEdge = false;
                    minEdgeValue = weight;
                    minVertexFound = j;
                    vertexConnectedTo = i;
                }
            }
        }
        tour.add(vertexConnectedTo, vertices.get(minVertexFound));
        vertices.remove(minVertexFound);
    }
    return tour;
}

/**
 * Finds a 2-approximation for a minimal vertex cover of the specified
 * graph. The algorithm promises a cover that is at most double the size of
 * a minimal cover. The algorithm takes O(|E|) time.
 *
 * <p>For more details see Jenny Walter, CMPU-240: Lecture notes for
 * Language Theory and Computation, Fall 2002, Vassar College, <a
 * href="http://www.cs.vassar.edu/~walter/cs241index/lectures/PDF/approx.pdf">
 * http://www.cs.vassar.edu/~walter/cs241index/lectures/PDF/approx.pdf</a>.
 * </p>
 *
 * @param g the graph for which vertex cover approximation is to be found.
 *
 * @return a set of vertices which is a vertex cover for the specified
 * graph.
 */
public static <V, E> Set<V> find2ApproximationCover(Graph<V, E> g) {
    // C <-- {}
    Set<V> cover = new HashSet<V>();
    // G'=(V',E') <-- G(V,E)
    Subgraph<V, E, Graph<V, E>> sg = new Subgraph<V, E, Graph<V, E>>(g, null, null);
    // while E' is non-empty
    while (sg.edgeSet().size() > 0) {
        // let (u,v) be an arbitrary edge of E'
        E e = sg.edgeSet().iterator().next();
        // C <-- C U {u,v}
        V u = g.getEdgeSource(e);
        V v = g.getEdgeTarget(e);
        cover.add(u);
        cover.add(v);
        // remove from E' every edge incident on either u or v
        sg.removeVertex(u);
        sg.removeVertex(v);
    }
    // return C
    return cover;
}

/**
 * Finds a greedy approximation for a minimal vertex cover of a specified
 * graph. At each iteration, the algorithm picks the vertex with the highest
 * degree and adds it to the cover, until all edges are covered.
 *
 * <p>The algorithm works on undirected graphs, but can also work on
 * directed graphs when their edge-directions are ignored. To ignore edge
 * directions you can use {@link org.jgrapht.Graphs#undirectedGraph(Graph)}
 * or {@link org.jgrapht.graph.AsUndirectedGraph}.</p>
 *
 * @param g the graph for which vertex cover approximation is to be found.
 *
 * @return a set of vertices which is a vertex cover for the specified
 * graph.
 */
public static <V, E> Set<V> findGreedyCover(UndirectedGraph<V, E> g) {
    // C <-- {}
    Set<V> cover = new HashSet<V>();
    // G' <-- G
    UndirectedGraph<V, E> sg = new UndirectedSubgraph<V, E>(g, null, null);
    // compare vertices in descending order of degree
    VertexDegreeComparator<V, E> comp = new VertexDegreeComparator<V, E>(sg);
    // while G' != {}
    while (sg.edgeSet().size() > 0) {
        // v <-- vertex with maximum degree in G'
        V v = Collections.max(sg.vertexSet(), comp);
        // C <-- C U {v}
        cover.add(v);
        // remove from G' every edge incident on v, and v itself
        sg.removeVertex(v);
    }
    return cover;
}

