    if (!simplePathsOnly && (maxPathLength == null)) {
        throw new IllegalArgumentException("If search is not restricted to simple paths, a maximum path length must be set to avoid infinite cycles");
    }
    if ((sourceVertices.isEmpty()) || (targetVertices.isEmpty())) {
        return new ArrayList();
    }
    // Decorate the edges with the minimum path lengths through them
    Map<E, Integer> edgeMinDistancesFromTargets = edgeMinDistancesBackwards(targetVertices, maxPathLength);
    // Generate all the paths
    List<GraphPath<V, E>> allPaths = generatePaths(sourceVertices, targetVertices, simplePathsOnly, maxPathLength, edgeMinDistancesFromTargets);
    return allPaths;
}

