 * null</tt>.
 *
 * @see Graph#addVertex(Object)
 */
public static <V, E> boolean addAllVertices(Graph<? super V, ? super E> destination, Collection<? extends V> vertices) {
    boolean modified = false;
    for (V v : vertices) {
